import './App.css';

function App() {
  function logcommands(e) {
    console.log(...e.target.files)
  }

  return (
    <div className="App">
     <h1> Tondeuses BimBamJob </h1>
     <input type="file" onChange={e=> { logcommands(e) }}/>
    </div>
  );
}

export default App;
